INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118061, "ペコリーヌとの出会い", "青空の下で謁見", "フリーマーケット会場", 8, 20063115, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2834, 40, 2, 10118, 91002, 7, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118062, "マホとの出会い", "未来の騎空団\nマスコット？", "フリーマーケット会場", 8, 20063115, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2835, 40, 2, 10118, 91002, 7, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118063, "アキノとの出会い", "お嬢さまからの\n緊急依頼", "ランドソル市街地", 8, 20063115, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2837, 40, 2, 10118, 91002, 7, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118064, "ジュンとの出会い", "黄金色の悩みごと", "フリーマーケット会場", 8, 20063115, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 4108402, 40, 2, 10118, 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118065, "カオリとの出会い", "白熱！　格闘大会！", "フリーマーケット会場", 8, 20063115, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 4107402, 40, 2, 10118, 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118066, "ニノンとの出会い", "祭り太鼓はオーエドの華", "オーエド町", 8, 20063115, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 9000227, 40, 2, 10118, 91002, 16, 1);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118067, "スズナとの出会い", "人気者は遅れて\nやってくる", "フリーマーケット会場", 8, 20063115, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 2101181, 40, 3, 10118, 91002, 19, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118068, "ナナカとの出会い", "巫女・ミーツ・魔法少女", "ランドソル市街地", 8, 20063115, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 4109402, 40, 3, 10118, 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118069, "キャル＆コッコロとの出会い", "ネズ耳は二度なくなる", "フリーマーケット会場", 8, 20063115, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 4305402, 40, 3, 10118, 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118070, "ユカリとの出会い", "この出会いにカンパイ！", "ランドソル市街地", 8, 20063115, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 4101402, 40, 3, 10118, 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118071, "アオイとの出会い", "陰陽アンサンブル", "ランドソル市街地", 8, 20063115, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 4106402, 40, 3, 10118, 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (1, 5118072, "シノブとの出会い", "運試し十番勝負！", "フリーマーケット会場", 8, 20063115, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 2836, 40, 3, 10118, 91002, 7, 1);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (0, 5118600, "オープニング", "彼女たちの新たな日常", 0, 0, 20063115, 0, 0, 0, 1, 10118, 0, 0, 0);
